current =0;
 var Hook=()=>{
     const [current,setvalue]=useState(0);
 }
 var jaya=()=>{
     setvalue(current+1);
    
 }

 var jonny=()=>{
    return(
        <>
            <h1>{current}</h1>
            <button onClick={jaya}>Click Me</button>
        </>
    );
 }
